import Intro from './components/Intro';
import Experience from './components/Experience';
import Project from './components/Project';
import TechBullets from './components/TechBullets';
import Footer from './components/Footer';
function App() {
  return (
    <div className="App">
      <Intro/>
      <Experience/>
      <Project/>
      <TechBullets/>
      <Footer />
    </div>
  );
}

export default App;
